INSERT INTO `alert` (`id`, `content`) VALUES
(1, 'Chào mừng bạn đến với server Nso Hồi Ức 2.0\n                 https://nsohuydat.online\n\n-----------------------------------\n- Nhận quà tân thủ tại NPC ĐẬU THẦN\n- CODE TÂN THỦ: NSOHOUC\n CODE ĐỀN BÙ: DENBU\n- GIFTCODE KHÁC HÃY LÊN WEB XEM Ở PHẦN TIN TỨC\n- Kiếm Lượng: điểm danh ngày, hoàn thành NVHN, hoàn thành 2 lần hang động, hoàn thành LDGT\n- Kiếm Xu: hoàn thành NVHN, chiến thắng/vào top CHIẾN TRƯỜNG\n- Kiếm Yên: Farm quái thường 500k yên, tinh anh 1tr yên, thủ lĩnh 2tr yên\n ZALO CHỦ SV  :   0962455206');
