(1, 3, 'upload/file/KWikB4wKDk_a4b023afcc2a0c74553b.jpg', 'MỞ CUỘC CHIẾN PK', 'mo-cuoc-chien-pk', 'MỞ CUỘC CHIẾN PK', '<p><span style=\"font-size:16px\"><span style=\"font-family:Courier New,Courier,monospace\"><em>Do nhiều anh em kh&ocirc;ng th&iacute;ch đua level v&agrave; cũng thể kh&ocirc;ng thể cạnh tranh được </em></span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:Courier New,Courier,monospace\"><em>N&ecirc;n m&igrave;nh quyết định tạo giải pk nhau h&agrave;ng tuần v&agrave; h&agrave;ng th&aacute;ng </em></span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:Courier New,Courier,monospace\"><em>Giải của c&aacute;c level 3x 4x 5x 6x 7x 8x 9x 13x 15x nh&eacute; </em></span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:Courier New,Courier,monospace\"><em>Giải sẽ được c&ocirc;ng bố sau</em></span></span></p>', 0, '2022-06-08 15:41:37', '2022-06-08 15:41:37'),
(2, 3, 'upload/file/PcDKPYrJFm_a4b023afcc2a0c74553b.jpg', 'Cuộc chiến pk', 'cuoc-chien-pk', 'Cuộc chiến pk', '<h1><span style=\"font-family:Comic Sans MS,cursive\">Do nhiều anh em kh&ocirc;ng th&iacute;ch đua level v&agrave; cũng thể kh&ocirc;ng thể cạnh tranh được </span></h1>\r\n\r\n<h1><span style=\"font-family:Comic Sans MS,cursive\">N&ecirc;n m&igrave;nh quyết định tạo giải pk nhau h&agrave;ng tuần v&agrave; h&agrave;ng th&aacute;ng</span></h1>\r\n\r\n<h1><span style=\"font-family:Comic Sans MS,cursive\">Giải của c&aacute;c level 3x 4x 5x 6x 7x 8x 9x 13x 15x nh&eacute;</span></h1>\r\n\r\n<h1><span style=\"font-family:Comic Sans MS,cursive\">Giải sẽ được c&ocirc;ng bố sau</span></h1>', 0, '2022-06-08 15:44:00', '2022-06-08 15:44:00'),
