(4, 3, 'upload/file/owfQpvFqFb_a4b023afcc2a0c74553b.jpg', 'GIFTCODE SEVER', 'giftcode-sever', 'GIFTCODE SEVER', '<p>GIFTCODE SEVER : NSOHOIUC</p>\r\n\r\n<p>GIFTCODE SEVER : denbu</p>', 0, '2022-06-08 15:46:16', '2022-06-11 11:32:41');
